$(function(){$(".delete").click(function(){Swal.fire({title:"Czy na pewno chcesz usunąć rekord?",icon:"warning",showCancelButton:"true",confirmButtonText:"Tak",cancelButtonText:"Nie"}).then(n=>{n.value&&$.ajax({headers:{"X-CSRF-TOKEN":$('meta[name="csrf-token"]').attr("content")},method:"DELETE",url:deleteUrl+$(this).data("id")}).done(function(e){window.location.reload()}).fail(function(e){Swal.fire("Oops...",e.responseJSON.message,e.responseJSON.status)})})})});
